import React, { useState, useCallback } from 'react';
import BluetoothComponent from './components/BluetoothComponent';
import ChatComponent from './components/ChatRoom';

const ParentComponent = () => {
  const [bluetoothMessageHandler, setBluetoothMessageHandler] = useState(null);

  const handleBluetoothMessage = useCallback((message) => {
    if (bluetoothMessageHandler) {
      bluetoothMessageHandler(message);
    }
  }, [bluetoothMessageHandler]);

  return (
    <div>
      <BluetoothComponent onReceiveBluetoothMessage={handleBluetoothMessage} />
      <ChatComponent setBluetoothMessageHandler={setBluetoothMessageHandler} />
    </div>
  );
};

export default ParentComponent;
